import React, { Component } from 'react';
import Botao from '../Botao/index';
import './index.css';

class Header extends Component {
  render(){
    return (
      <header className = "header">

        <div className = "headerBottomsLeft">
          <Botao nome = "Home" className = "headerBottom" link = "/"/>
          <Botao nome = "Filmes" className = "headerBottom" link = "/listaFilmes"/>
        </div>

        <p className = "siteName"> moviesplusplus.com.br </p>

        <div className = "headerBottomsRight">
          <Botao nome = "OI" className = "headerBottom" link = "/" />
          <Botao nome = "TCHAU" className = "headerBottom" link = "/" />
        </div>

      </header>
    );
  }
}

export default Header;
